ame=\"Timer duration\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"long\" name=\"One hour\" />\n          <activiti:value id=\"short\" name=\"10 seconds\" />\n        </activiti:formProperty>\n      </extensionElements>\n    </startEvent>\n\n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"exclusiveGw\" />\n\n    <exclusiveGateway id=\"exclusiveGw\" name=\"Exclusive Timer duration gateway\" />\n\n    <sequenceFlow id=\"flow2\" sourceRef=\"exclusiveGw\" targetRef=\"longTimerTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${duration == \'long\'}</conditionExpression>\n    </sequenceFlow>\n\n    <sequenceFlow id=\"flow3\" sourceRef=\"exclusiveGw\" targetRef=\"shortTimerTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${duration == \'short\'}</conditionExpression>\n    </sequenceFlow>\n\n    <userTask id=\"longTimerTask\" name=\"Task with timer on it\">\n      <documentation>This task has a timer on it</documentation>\n    </userTask>\n    <boundaryEvent id=\"longTimer\" cancelActivity=\"true\" attachedToRef=\"longTimerTask\">\n      <timerEventDefinition>\n        <timeDuration>PT1H</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n\n    <sequenceFlow id=\"flow4\" sourceRef=\"longTimerTask\" targetRef=\"theEnd\" />\n    <sequenceFlow id=\"flow5\" sourceRef=\"longTimer\" targetRef=\"longTimerExpire\" />\n\n    <scriptTask id=\"longTimerExpire\" name=\"Execute script\" scriptFormat=\"groovy\">\n      <script>\n        if(throwException == \'true\') {\n          throw new java.lang.RuntimeException(\'Activiti Engine Rocks!\');\n        }\n      </script>\n    </scriptTask>\n\n    <sequenceFlow id=\"flow6\" sourceRef=\"longTimerExpire\" targetRef=\"theEnd\" />\n\n    <userTask id=\"shortTimerTask\" name=\"my task\">\n     \n    </userTask>\n    <boundaryEvent id=\"shortTimer\" cancelActivity=\"true\" attachedToRef=\"shortTimerTask\">\n      <timerEventDefinition>\n        <timeDuration>PT10S</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n\n    <sequenceFlow id=\"flow7\" sourceRef=\"shortTimerTask\" targetRef=\"theEnd\" />\n    <sequenceFlow id=\"flow8\" sourceRef=\"shortTimer\" targetRef=\"shortTimerExpire\" />\n    \n    <scriptTask id=\"shortTimerExpire\" name=\"Execute script\" scriptFormat=\"js\">\n      <script>\n        if(throwException == \'true\') {\n          throw new java.lang.RuntimeException(\'Activiti Engine Rocks!\');\n        }\n      </script>\n    </scriptTask>\n\n    <sequenceFlow id=\"flow9\" sourceRef=\"shortTimerExpire\" targetRef=\"theEnd\" />\n\n    <endEvent id=\"theEnd\" />\n\n  </process>\n\n</definitions>\n',0),('28',1,'org/activiti/explorer/demo/process/simple-approval.bpmn20.xml','23','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n  xmlns:activiti=\"http://activiti.org/bpmn\" xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n  xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n  expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"Cool Processes\">\n  <process id=\"simpleApprovalProcess\" name=\"Simple approval process\">\n    \n    <documentation>This is a simple approval process.</documentation>\n    \n    <startEvent id=\"startevent2\" name=\"Start\" activiti:initiator=\"initiator\">\n      <extensionElements>\n        <activiti:formProperty id=\"approver\" name=\"Approver\" type=\"user\" required=\"true\" />\n        <activiti:formProperty id=\"duedate\" name=\"Approval due date\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"difficulty\" name=\"Difficulty (number)\" type=\"long\" />\n        <activiti:formProperty id=\"instructions\" name=\"Instructions\" type=\"string\" />\n      </extensionElements>\n    </startEvent>\n    \n    <userTask id=\"usertask2\" name=\"Approval task\" activiti:assignee=\"${approver}\" activiti:dueDate=\"${duedate}\">\n      <documentation>Approval request created by ${initiator}: ${instructions} </documentation>\n      <extensionElements>\n         <activiti:formProperty id=\"approved\" name=\"Decision\" type=\"enum\"\n          required=\"true\">\n          <activiti:value id=\"true\" name=\"Approve\" />\n          <activiti:value id=\"false\" name=\"Reject\" />\n        </activiti:formProperty>\n        <activiti:formProperty id=\"motivation\" name=\"Motivation\" type=\"string\" required=\"true\" />\n      </extensionElements>\n    </userTask>\n    <endEvent id=\"endevent2\" name=\"End\"></endEvent>\n    <sequenceFlow id=\"flow3\" name=\"\" sourceRef=\"startevent2\" targetRef=\"usertask2\"></sequenceFlow>\n    <sequenceFlow id=\"flow4\" name=\"\" sourceRef=\"usertask2\" targetRef=\"usertask3\"></sequenceFlow>\n    \n    <userTask id=\"usertask3\" name=\"Check outcome\" activiti:assignee=\"${initiator}\">\n      <documentation textFormat=\"text/plain\">Task completed by ${approver}: ${(approved.equals(\'true\')) ? \'Approved.\' : \'Rejected!\'}</documentation>\n      <extensionElements>\n         <activiti:formProperty id=\"motivation\" name=\"Motivation\" type=\"string\" writable=\"false\" />\n      </extensionElements>\n    </userTask>\n    <sequenceFlow id=\"flow5\" name=\"\" sourceRef=\"usertask3\" targetRef=\"endevent2\"></sequenceFlow>\n  </process>\n\n\n  <bpmndi:BPMNDiagram id=\"BPMNDiagram_simpleApprovalProcess\">\n    <bpmndi:BPMNPlane bpmnElement=\"simpleApprovalProcess\" id=\"BPMNPlane_simpleApprovalProcess\">\n      <bpmndi:BPMNShape bpmnElement=\"startevent2\" id=\"BPMNShape_startevent2\">\n        <omgdc:Bounds height=\"55\" width=\"55\" x=\"200\" y=\"180\"></omgdc:Bounds>\n      </bpmndi:BPMNShape>\n      <bpmndi:BPMNShape bpmnElement=\"usertask2\" id=\"BPMNShape_usertask2\">\n        <omg